import React, { useEffect } from 'react';
import { Paper, Typography, CircularProgress, Divider, CardActions } from '@material-ui/core/';
import { useDispatch, useSelector } from 'react-redux';
import moment from 'moment';
import { useParams, useHistory } from 'react-router-dom';

import { getPost, getPostsBySearch } from '../../actions/posts';
import useStyles from './styles';
import cuci from '../../images/motorcycle.png';

const PelangganDetails = () => {
  const user = JSON.parse(localStorage.getItem('profile'));

  const dispatch = useDispatch();
  const history = useHistory();
  const classes = useStyles();
  const { id } = useParams();



  return (
    <Paper style={{ padding: '20px', borderRadius: '15px' }} elevation={6}>
      <div className={classes.card}>
        <div className={classes.section}>
          <Typography variant="h3" component="h2">Wandi</Typography>
          <Typography gutterBottom variant="subtitle1" color="inherit" component="h2">081222221180</Typography>
          <Divider style={{ margin: '20px 0' }} />
          <CardActions className={classes.cardActions} >
            <Typography variant="subtitle1" color="inherit">Slot:  1</Typography>
            <Divider orientation="vertical" flexItem />
            <Typography variant="subtitle1" color="inherit">pencucian</Typography>
          </CardActions>
          <Divider style={{ margin: '20px 0' }} />
          <Typography variant="body1">Waktu Pesan : </Typography>
          <Divider style={{ margin: '20px 0' }} />
          <CardActions className={classes.cardActions} >
            <Typography variant="h6" color="inherit">Vega-ZR</Typography>
            <Divider orientation="vertical" flexItem />
            <Typography variant="h6" color="inherit">B6678PKL</Typography>
          </CardActions>
          <Divider style={{ margin: '20px 0' }} />
          <CardActions className={classes.cardActions} >
            <Typography variant="h6" color="inherit">Pencuci John</Typography>
            <Divider orientation="vertical" flexItem />
            <Typography variant="subtitle1" color="inherit">Rp.10.000</Typography>
          </CardActions>
          <Divider style={{ margin: '20px 0' }} />
          <Typography variant="h6">Created by: admin 1</Typography>
          <Divider style={{ margin: '20px 0' }} />
        </div>
        <div className={classes.imageSection}>
          <img className={classes.media} src={cuci} alt="Wandi" />
        </div>
      </div>
    </Paper>
  )
}

export default PelangganDetails;
